import * as actionTypes from './actionTypes';

const initState ={
    playlist: null
}

export default (state = initState, action) =>{
    switch (action.type) {
        case actionTypes.HANGE_CHANGE:
            return {
                ...state,
                playlist: action.payload,
                isFetching: true
            }
        default:
            return {
                ...state,
            }
    }
}
